import { Form, Button, Input, Select, DatePicker, Layout} from 'antd'
import React from 'react';

import { IMaskInput } from "react-imask";




const { Option } = Select;

const App: React.FC = () => {
    const dateFormat = 'DD/MM/YYYY';
    
    const [form] = Form.useForm();
  
    function finish(values: any){
        console.log(values);        
    };  

  return (
    <Form form= {form} name = "control-hooks" onFinish={finish}>
        <Form.Item
            name={['name']}
            label= "Nome completo"
            rules={[{required: true}]}
        >
            <Input placeholder='Nome completo'></Input>
        </Form.Item>

        <Form.Item name="gender" label="Genêro" rules={[{required: true}]}>
            <Select
                placeholder='Selecione seu sexo'   
                allowClear    
            >                
                <Option value="male" >Masculino</Option>
                <Option value="female">Feminino</Option>
                <Option value="other">Outro</Option>
            </Select>
        </Form.Item>

        <Form.Item
            name={['birth']} 
            label="Data de nascimento"  
            rules={[{required: true}]}   
               
        >
            <DatePicker picker="date" placeholder='Data de nascimento' format={dateFormat}></DatePicker>

        </Form.Item>

        <Form.Item
            name={['email']}
            label="email"
            rules={[
                {required: true},
                {type:'email',
                message:"Este email não é valido"}
            
            ]}
        >   
            <Input></Input>

        </Form.Item>

        <Form.Item
            name={['phone']}
            label="Telefone"
            rules={[{required: true}]}
            
        >
            <Input type='phone'              
            ></Input>
        </Form.Item>
        <Button type="primary" htmlType="submit">Salvar</Button>

        


    </Form>
  )

}
export default App;
